import Skills from './Components/Skills/Skills';

function App() {
  return (
    <div className="PageBody" >
      <div id="particle-canvas"></div>

    <Header />
    <HomeBanner/>
    <Navbar/>
    <Skills/>
    <profile/>
    </div>

  );
};

export default App;
